import styled from 'styled-components';

export default styled.div`
    border: 2px solid #28b0bf;
    border-radius: 10px;
    display: inline-flex;
    padding: 5px 15px 5px 15px;
    background-color: white;
    a {
        color: #28b0bf;
        text-decoration: none;
    }
`;
